defs.script:
var a1_idx;
var a1_on;
var a1_fr;
var a1_btnPauseLeft,a1_btnPlayLeft,a1_btnPauseRight,a1_btnPlayRight;
var a1_playsRight,a1_isPaused;
var a1_int;
var a1_pause,a1_playRight,a1_playLeft,a1_playBwd,a1_playFwd;
var a1_fps,a1_spd;
var a1_setFps;
var a1_seekFrame,a1_gotoNext,a1_gotoPrev;
var a1_stopFirst,a1_stopLast;
var a1_playPauseBwd,a1_playPauseFwd;
var a1_stepBwd,a1_stepFwd;
var a1_spdIncr,a1_spdDecr,a1_spdReset;
(function(){
function onload(){
if(!a1_fr){
a1_fr=new Array();
a1_on=0;
var ocg=document.getElementsByClassName('ocg');
for(var i=0;i<ocg.length;i++){
var ocgName=ocg[i].getAttribute('id').split('.');
if(ocgName[0]==1){
a1_fr[ocgName[1]]=ocg[i];
}
}
a1_btnPauseLeft=document.getElementById('1.PauseLeft');
a1_btnPlayLeft=document.getElementById('1.PlayLeft');
a1_btnPauseRight=document.getElementById('1.PauseRight');
a1_btnPlayRight=document.getElementById('1.PlayRight');
a1_playsRight=true;
a1_isPaused=false;
a1_playing=false;
a1_fps=2;
a1_spd=1;
a1_setFps=function(f){
a1_fps=(f==0?1e-6:f);
if(a1_playing){
if(a1_playsRight){a1_playRight();}else{a1_playLeft();}
}
};
a1_seekFrame=function(f){
if(f>4||f<0){return -1;}
a1_idx=f;
a1_fr[a1_on].setAttribute('visibility','hidden');
a1_fr[f].setAttribute('visibility','visible');
a1_on=f;
return 0;
};
a1_stopFirst=function(){a1_pause(true);a1_seekFrame(0);};
a1_stopLast=function(){a1_pause(true);a1_seekFrame(4);};
a1_gotoNext=function(){
if(a1_seekFrame(a1_idx+1)<0){
a1_stopLast();
return;
}
};
a1_gotoPrev=function(){
if(a1_seekFrame(a1_idx-1)<0){
a1_stopFirst();
return;
}
};
a1_pause=function(stop){
try{clearInterval(a1_int);}catch(e){}
a1_playing=false;
a1_isPaused=!stop;
a1_btnPauseLeft.setAttribute('visibility','hidden');
a1_btnPlayLeft.setAttribute('visibility','visible');
a1_btnPauseRight.setAttribute('visibility','hidden');
a1_btnPlayRight.setAttribute('visibility','visible');
};
a1_playRight=function(){
var tmp_int;
try{tmp_int=setInterval('a1_gotoNext()',1000/a1_fps/a1_spd);}catch(e){}
try{clearInterval(a1_int);}catch(e){}
a1_int=tmp_int;
a1_playsRight=true;
a1_playing=true;
a1_isPaused=false;
a1_btnPauseLeft.setAttribute('visibility','visible');
a1_btnPlayLeft.setAttribute('visibility','hidden');
a1_btnPauseRight.setAttribute('visibility','visible');
a1_btnPlayRight.setAttribute('visibility','hidden');
};
a1_playLeft=function(){
var tmp_int;
try{tmp_int=setInterval('a1_gotoPrev()',1000/a1_fps/a1_spd);}catch(e){}
try{clearInterval(a1_int);}catch(e){}
a1_int=tmp_int;
a1_playsRight=false;
a1_playing=true;
a1_isPaused=false;
a1_btnPauseLeft.setAttribute('visibility','visible');
a1_btnPlayLeft.setAttribute('visibility','hidden');
a1_btnPauseRight.setAttribute('visibility','visible');
a1_btnPlayRight.setAttribute('visibility','hidden');
};
a1_playPauseBwd=function(){if(a1_playing){a1_pause();}else{a1_playBwd();}};
a1_playPauseFwd=function(){if(a1_playing){a1_pause();}else{a1_playFwd();}};
a1_spdIncr=function(){a1_spd*=1.1;a1_setFps(a1_fps);};
a1_spdDecr=function(){a1_spd/=1.1;a1_setFps(a1_fps);};
a1_spdReset=function(){a1_spd=1;a1_setFps(a1_fps);};
a1_stepBwd=function(){if(!a1_playing){a1_seekFrame(a1_idx-1);a1_isPaused=true;}};
a1_stepFwd=function(){if(!a1_playing){a1_seekFrame(a1_idx+1);a1_isPaused=true;}};
a1_playBwd=function(){if(a1_idx==0||!a1_isPaused){a1_stopLast();}a1_playLeft();};
a1_playFwd=function(){if(a1_idx==4||!a1_isPaused){a1_stopFirst();}a1_playRight();};
a1_seekFrame(0);
}document.getElementById('anm1').addEventListener('mouseup',onMouseUpWdgt);
document.getElementById('anm1').addEventListener('mousedown',onMouseDownWdgt);
document.getElementById('anm1').addEventListener('touchend',onTouchEndWdgt);
document.getElementById('anm1').addEventListener('touchstart',onTouchStartWdgt);
document.getElementById('anm1').addEventListener('touchmove',onTouchMove);
onvisible();
}
function onvisible(){
}
function onhidden(){
if(a1_playing){a1_pause(true);}
if(!a1_isPaused)a1_playsRight=true;
if(!a1_isPaused&&a1_idx!=0)a1_seekFrame(0);
}
function onVisibilityChange(){
if(document.hidden){try{onhidden();}catch(e){}}else{try{onvisible();}catch(e){}}
}
document.addEventListener('visibilitychange',onVisibilityChange);
window.addEventListener('load',onload);
var permPause1=false; function onWidgetUpAction(event){
try{
if(!a1_isPaused)a1_stopFirst();
if(event.shiftKey)a1_playsRight=!a1_playsRight;
if(a1_idx==4&&a1_playsRight)a1_stopFirst();
if(a1_idx==0&&!a1_playsRight)a1_stopLast();
if(a1_playsRight){a1_playRight();}else{a1_playLeft();}
}catch(e){}
}
function onTouchStartWdgt(event){
event.preventDefault();
event.stopPropagation();
permPause1=false; try{if(a1_playing){a1_pause();}}catch(e){}
}
function onTouchEndWdgt(event){
event.preventDefault();
event.stopPropagation();
if(event.targetTouches.length>0){permPause1=true;}
else{
if(permPause1){permPause1=false;}
else{onWidgetUpAction(event);}
}
}
function onTouchMove(event){
event.preventDefault();
event.stopPropagation();
}
function onMouseDownWdgt(event){
event.preventDefault();
event.stopPropagation();
try{if(a1_playing){a1_pause();}}catch(e){}
}
function onMouseUpWdgt(event){
event.preventDefault();
event.stopPropagation();
onWidgetUpAction(event);
}
})();
